import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'styled-bootstrap-grid';

import TripCard from '../../components/TripCard';
import { spacing, Section } from '../../theme';

const ProvinceSection = () => {
  const [trip, setTrip] = useState({ allTrips: '' });
  useEffect(() => {
    const api = 'https://api.myjson.com/bins/k3hyi';
    axios
      .get(api)
      .then((trips) => {
        setTrip({ allTrips: trips.data });
      })
      .catch(error => console.log(error));
  });

  return (
    <Section spacing={spacing.medium} textCenter>
      <Container>
        <Row>
          <Col col={12}>
            {console.log(trip.allTrips[0].name)}

            <h2>Explore trips from local</h2>
            <p>Get your self into new environment and feel the nature. Discover local unseen place with local people.</p>

            <TripCard eachTrip={trip.allTrips[0]} />

            {/* { trip.map((place) => (
              <TripCard name={place} edit={index} />
            )) } */}
          </Col>
        </Row>
      </Container>
    </Section>
  );
};

export default ProvinceSection;
